Vous imaginez l'émotion !
Elle m'a ainsi accompagné tout au long du chemin pour aller dans la galerie d'expression abstraite "Abstract Project". J'ai alors démarré cette peinture aux couleurs gaies en essayant de traduire une énergie positive comme ce petit bout d'humain qui n'était que joie et pétillance.
